import * as React from 'react';
import "./DashboardStyle.css";
import { Grid } from "@material-ui/core"
import { ExitToApp } from "@material-ui/icons"
import { history } from '../History';
import { useSelector } from 'react-redux';

export default function () {
    const student=useSelector((state)=>(state.student[0]));console.log(student[0].Name);
    const logout = () => {
        history.push({
            pathname: `/`,
        });
    };
    
    return (
        <div className='student'>
            <div className='header'>
                <a onClick={logout}><ExitToApp style={{ float: 'right', margin: '10px', color: '#203e57', width: '50px', height: '50px' }} /></a>
                <h1 className='hello'>Hello, {student[0].Name}</h1>
            </div>
            <Grid container direction='column' justifyContent='center'>
                <Grid item justifyContent='center'>
                    <h2 className='hello'>Your Score is <br />89 out of 100</h2>
                    <h2 className='hello'>You have 5 Assigned Work</h2>
                </Grid>
                <Grid item justifyContent='center' style={{ textAlign: 'center' }}>
                    <button className='dashboardbutton'>ASSIGNED</button>
                </Grid>
                <Grid item justifyContent='center' style={{ textAlign: 'center' }}>
                    <button className='dashboardbutton'>SUBMITTED</button>
                </Grid>
            </Grid>
        </div>
    );
};
